import React, {useState} from 'react'
import UserLogin from './Components/UserLogin/userlogin';
import './App.css';

function App() {
  const [authenticated, setAuthenticated] = useState(false)
  return (
    <div className="App">
      {authenticated ? (<h1>Welcome Eterna Primavera.</h1>) : (<UserLogin setAuthenticated={setAuthenticated}>Account Locked.</UserLogin>)}
    </div>
  );
}

export default App;
